    "big-muddy-national-fish-wildlife-refuge-hunting-chapter-of-visitor-services-plan",nt"isopen":
    false,nt"url": null,nt"notes": "The Refuge staff developed this Hunting
    Plan to guide hunting on the Refuge and fulfill the purposes for which the Refuge
    was established. This plan provides guidelines for the administration of hunting
    activity and for the development, maintenance, and enforcement of regulations and
    guidelines on Big Muddy National Fish and Wildlife Refuge. It specifically addresses
    the areas of information, access, use patterns, regulations, area restrictions,
    permits, and enforcement. Target species include; white-tailed deer, waterfowl,
    turkey, upland game, and furbearers.",nt"license_title": "License Not Specified",nt"extras":
